import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

import { createBrowserRouter, RouterProvider } from 'react-router-dom'

// COMPONENTS //
import App from './components/App';
import MainPage from './components/MainPage';
import About from './components/About';
import ParticipantList from './components/ParticipantList';
import NewParticipantForm from './components/NewParticipantForm';
import ErrorPage from './components/ErrorPage'
// STEP 10 Import Participant Page and CaseList and CasePage
import CaseList  from './components/CaseList';
import ParticipantPage from './components/ParticipantPage';
import CasePage from './components/CasePage';

// LOADERS //
// import {  } from './loaders'
// STEP 1 Add loaders 
// STEP 10 goes back here to load the single participant
// STEP 15 Back here again to add the single case loader
import { getParticipantsLoader, getCasesLoader, singleParticipantLoader, singleCaseLoader} from './loaders'
import EnrollmentTrends from './components/EnrollmentTrends';

// we place all our routes in the array below
const router = createBrowserRouter([
    {
        path: "/",
        element: <App />,
        errorElement: <ErrorPage />,
        children: [ // children are sub-routes for our main App
            {
                index: true, // this is the default route inside App
                element: <MainPage />
            },
            {
                path: "about",
                element: <About />
            },
            {
                path: "form",
                element: <NewParticipantForm />
            },
            {
                path: "registry",
                element: <ParticipantList />,
                //STEP 1 Add loaders. Don't forget commas in items above.
                loader: getParticipantsLoader
            },
            //STEP 9: Make a path for the individual Participant ID -- Note it's the Participant page
            // Also add the loader while you're at it
            {
                path: "registry/:id",
                element: <ParticipantPage />,
                // Add loaders. Don't forget commas in items above.
                loader: singleParticipantLoader
            },

            // STEP 4 Add path for Case List and put in cases loader
            {
                path: "caselist",
                element: <CaseList />,
                loader: getCasesLoader
            },
            // STEP 14: Add a path for the individual case ID -- Note it's CasePage
            {
                path: "caselist/:id",
                element: <CasePage />,
                loader: singleCaseLoader
            },
            {
                path: "caselist",
                element: <EnrollmentTrends />,
                loader: getCasesLoader
            },
        ]
    },
])

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render( <RouterProvider router={router} /> );
